    state = {
        page: '',

    }
    render (){
        return (        
        <div className={style.container}>
            <div className={style.pastille}>
                <div className={style.pastilleLeft}>

                </div>
                <div className={style.pastilleRight}>

                </div>    
            </div>
        </div>
        );
    }
}

export default Radium(container);
